package main

import (
	"bytes"
	"fmt"

	"github.com/lukechampine/advent/utils"
)

var input = []byte(``)

const capDist = 'a' - 'A'

func react(polymer []byte) ([]byte, bool) {
	for i := 0; i < len(polymer)-1; i++ {
		if utils.Abs(int(polymer[i])-int(polymer[i+1])) == capDist {
			return append(polymer[:i], polymer[i+2:]...), true
		}
	}
	return polymer, false
}

func reducedLen(polymer []byte) int {
	changed := true
	for changed {
		polymer, changed = react(polymer)
	}
	return len(polymer)
}

func copyBytes(b []byte) []byte {
	return append([]byte(nil), b...)
}

func main() {
	// part 1
	fmt.Println(reducedLen(copyBytes(input)))

	// part 2
	lower := []byte("abcdefghijklmnopqrstuvwxyz")
	upper := []byte("ABCDEFGHIJKLMNOPQRSTUVWXYZ")
	min := utils.Minimum(len(lower), func(i int) int {
		in := copyBytes(input)
		in = bytes.Replace(in, []byte{lower[i]}, nil, -1)
		in = bytes.Replace(in, []byte{upper[i]}, nil, -1)
		return reducedLen(in)
	})
	fmt.Println(min)
}
